import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="">
      <label>
        <input type="checkbox" />
        <span class="menu">
          {" "}
          <span class="hamburger"></span>{" "}
        </span>
        <ul>
        {/* <Link className="homeLink" to="/">
              Home
            </Link>
            <Link className="orderLink" to="/">
              Order
            </Link>
            <Link className="leaderboardsLink" to="/">
              Leaderboards
            </Link>{" "}
            <Link className="marketplaceLink" to="/">
              Marketplace
            </Link>{" "}
            <Link className="faqsLink" to="/faqs">
              FAQs
            </Link> */}
          <li>
            {" "}
            <a href="#">Home</a>{" "}
          </li>
          <li>
            {" "}
            <a href="#">Order</a>{" "}
          </li>
          <li>
            {" "}
            <a href="#">Leaderboards</a>{" "}
          </li><li>
            {" "}
            <a href="#">Marketplace</a>{" "}
          </li><li>
            {" "}
            <a href="/faqs">FAQs</a>{" "}
          </li>
        </ul>
      </label>

      {/* <input type="checkbox" id="hamburger-input" className="burger-shower" />
      <label id="hamburger-menu">
        <nav id="sidebar-menu">
          <h3>Menu</h3>
          <ul>
            <Link className="homeLink" to="/">
              Home
            </Link>
            <Link className="orderLink" to="/">
              Order
            </Link>
            <Link className="leaderboardsLink" to="/">
              Leaderboards
            </Link>{" "}
            <Link className="marketplaceLink" to="/">
              Marketplace
            </Link>{" "}
            <Link className="faqsLink" to="/faqs">
              FAQs
            </Link>{" "}
          </ul>
        </nav>
      </label> */}

      {/* <div class="overlay"></div> */}
      <Link to="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </Link>
      <nav className="navbar">
        {" "}
        <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link>
      </nav>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
